/*!50003 CREATE*/ /*!50017 DEFINER=`root`@`localhost`*/ /*!50003 TRIGGER `insert_orderdetails` BEFORE INSERT ON `orderdetails` FOR EACH ROW BEGIN
	DECLARE countInStock , price , order_id, totalPrice,saleOff int default 0;
    DECLARE HET_HANG CONDITION FOR SQLSTATE '45000';
    DECLARE message nvarchar(128);
   
    Select p.in_stock,p.price , o.totalPrice ,p.saleOff
    into @countInStock, @price , @totalPrice,@saleOff
    from product as p, billorder as o 
    where p.id = NEW.product_id and o.id = NEW.order_id;
	
    IF (@countInStock<NEW.quantity) THEN
		Select CONCAT(
        '
        Số lượng ',name , ' không đủ để bán.Lượng ',name , ' tồn  kho: ',in_stock,'.Số lượng ',name , ' khách hàng mua: ',NEW.quantity) 
        into @message from product 
        where id = new.product_id;
		SIGNAL HET_HANG SET MESSAGE_TEXT = @message;
	ELSE 
		Set @price = @price*(100-@saleOff)/100;
        
        UPDATE product SET in_stock = @countInStock - NEW.quantity 
        where id=NEW.product_id;
        
		UPDATE billorder SET  totalPrice =  @totalPrice + New.quantity*@price
        WHERE id = NEW.order_id;

	END IF;
END */;;
