/*!50003 CREATE*/ /*!50017 DEFINER=`root`@`localhost`*/ /*!50003 TRIGGER `delete_orderdetails` BEFORE DELETE ON `orderdetails` FOR EACH ROW BEGIN
	DECLARE countInStock , price , totalPrice,saleOff int default 0;
   
    Select p.in_stock,p.price , o.totalPrice ,p.saleOff
    into @countInStock, @price , @totalPrice,@saleOff
    from product as p, billorder as o where p.id = OLD.product_id AND o.id = OLD.order_id;
	
	Set @price = @price*(100-@saleOff)/100;
	
	UPDATE product SET in_stock = @countInStock + OLD.quantity 
